import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Home from './pages/Home';
import Odjeca from './pages/Odjeca';

function App() {
  return (
    <div className="App">
    <Router>
      <Switch>
        <Route path="/" exact component={Odjeca}/>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
